    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](80, "La presente Pol\u00EDtica de Privacidad establece los t\u00E9rminos en que Ralph usa y protege la informaci\u00F3n que es proporcionada por sus usuarios al momento de utilizar su aplicaci\u00F3n web. Esta compa\u00F1\u00EDa est\u00E1 comprometida con la seguridad de los datos de sus usuarios. Cuando le pedimos llenar los campos de informaci\u00F3n personal con la cual usted pueda ser identificado, lo hacemos asegurando que s\u00F3lo se emplear\u00E1 de acuerdo con los t\u00E9rminos de este documento. Sin embargo esta Pol\u00EDtica de Privacidad puede cambiar con el tiempo o ser actualizada por lo que le recomendamos y enfatizamos revisar continuamente esta p\u00E1gina para asegurarse que est\u00E1 de acuerdo con dichos cambios.");
