    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](87, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](88, "En caso de ser un cliente o usuario: Nombre, apellido, informaci\u00F3n de contacto como correo electr\u00F3nico o tel\u00E9fono, municipio y contrase\u00F1a de acceso.");
