    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](89, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](90, "En caso de ser un restaurante o negocio de comida: Los mismos datos que un usuario, y agregando el nombre de su negocio, horario de apertura, domicilio en el que est\u00E1 ubicado y tel\u00E9fono de servicio.");
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](91, "p", 61);
