    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](97, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](98, "Nuestra aplicaci\u00F3n web emplea la informaci\u00F3n recogida con el fin de proporcionar el mejor servicio posible, particularmente para mantener un registro de usuarios, de pedidos en caso que aplique, y mejorar nuestro servicio. Al momento de hacer un pedido, se le muestra al restaurante su nombre y apellido, su n\u00FAmero de tel\u00E9fono y la direcci\u00F3n de entrega que usted haya escrito para ese pedido en espec\u00EDfico. El tel\u00E9fono es necesario por si el restaurante necesita comunicarse con usted por alguna situaci\u00F3n extraordinaria (como el hecho de que ya no tenga del producto que acaba de hacer el pedido, que la direcci\u00F3n de entrega proporcionada no exista, o cualquier otra situci\u00F3n que el restaurante necesite comunicarle). La informaci\u00F3n sobre el municipio al que pertenece, es para mostrarle los restaurantes y sus productos que est\u00E1n disponibles en el municipio al cual usted pertenece, y regular el que usted intente hacer pedidos a restaurantes de otros municipios. Su correo electr\u00F3nico y contrase\u00F1a fueron necesarios para que usted pudiera iniciar sesi\u00F3n en los dispositivos que usted dese\u00E9 y no permitir que otra persona que no sabe su correo electr\u00F3nico y su contrase\u00F1a, pueda hacer pedidos utilizando sus datos.");
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](99, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](100, "Si tiene un restaurante, los datos del nombre del restaurante, el horario, la ubicaci\u00F3n y todo su men\u00FA, ser\u00E1n mostrados a los usuarios para que puedan decidirse a hacer un pedido y/o conocer m\u00E1s sobre su negocio. El tel\u00E9fono de contacto de su negocio, s\u00F3lo se le mostrar\u00E1 en algunas ocasiones a los usuarios al momento de hacer un pedido, por cualquier situaci\u00F3n en que el cliente necesite comunicarse con usted despu\u00E9s de haber realizado su pedido. Nosotros conservamos su informaci\u00F3n \u00FAnicamente durante el tiempo que usted mantenga una cuenta creada en nuestra plataforma; en caso de que usted decida eliminar su cuenta de Ralph por cualquier motivo, eliminaremos sus datos de nuestra base de datos.");
