    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](102, "Es posible que sean enviadas notificaciones peri\u00F3dicamente (por medio de notificaciones push, mensajes sms o correo electr\u00F3nico) con ofertas especiales, nuevos productos y otra informaci\u00F3n publicitaria que consideremos relevante para usted o que pueda brindarle alg\u00FAn beneficio; estas notificaciones ser\u00E1n enviados a el correo electr\u00F3nico o tel\u00E9fono que usted proporcion\u00F3 y podr\u00E1n ser cancelados en cualquier momento.");
