    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](107, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](108, "Ralph est\u00E1 altamente comprometido en cumplir con el compromiso de mantener su informaci\u00F3n segura. Usamos sistemas y t\u00E9cnicas avanzadas y las actualizaremos constantemente, para asegurarnos que no exista ning\u00FAn acceso no autorizado. Todos los env\u00EDos de informaci\u00F3n a trav\u00E9s de la aplicaci\u00F3n web es encriptada mediante la tecnolog\u00EDa Secure Socket Layer (SSL).");
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](109, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](110, "Para proteger su informaci\u00F3n personal, tomamos precauciones razonables y seguimos las mejores pr\u00E1cticas de la industria para asegurarnos de que no haya p\u00E9rdida de manera inapropiada, mal uso, acceso, divulgaci\u00F3n, alteraci\u00F3n o destrucci\u00F3n de la misma. As\u00ED mismo, debe tener en cuenta que no nos hacemos responsables de cualquier tipo de intersecci\u00F3n de una petici\u00F3n que se realice al servidor o alg\u00FAn robo o mal uso de uno de sus datos personales, aunque se le recompensar\u00E1 al usuario afectado con alg\u00FAn cup\u00F3n o promoci\u00F3n especial y tomaremos acci\u00F3n inmediata para arreglar el problema, aumentar nuestra seguridad y prevenir futuros robos de informaci\u00F3n por medio de nuestra aplicaci\u00F3n web.");
