    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](115, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](116, "Una cookie se refiere a un fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador, al aceptar dicho fichero se crea y la cookie sirve entonces para tener informaci\u00F3n respecto al tr\u00E1fico web, y tambi\u00E9n facilita las futuras visitas a una web recurrente. Otra funci\u00F3n que tienen las cookies es que con ellas las web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de su web.");
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](117, "p", 61);
    _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](118, "Nuestra aplicaci\u00F3n web emplea las cookies para poder identificar las p\u00E1ginas que son visitadas y su frecuencia. Esta informaci\u00F3n es empleada \u00FAnicamente para an\u00E1lisis estad\u00EDstico y despu\u00E9s la informaci\u00F3n se elimina de forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin embargo las cookies ayudan a proporcionar un mejor servicio de los sitios web, \u00E9stas no dan acceso a informaci\u00F3n de su ordenador ni de usted, a menos de que usted as\u00ED lo quiera y la proporcione directamente. Usted puede aceptar o negar el uso de cookies, sin embargo la mayor\u00EDa de navegadores aceptan cookies autom\u00E1ticamente, pues sirve para tener un mejor servicio web. Tambi\u00E9n usted puede cambiar la configuraci\u00F3n de su ordenador para declinar las cookies. Si se declinan es posible que no pueda utilizar algunos de nuestros servicios.");
